import React from "react";
import { View, Text, Button, StyleSheet, Linking, ScrollView } from "react-native";

const App = () => {
  return (
    <ScrollView contentContainerStyle={styles.container}>
      <Text style={styles.header}>Welcome to My Personal Page</Text>
      <Text style={styles.subtitle}>Here are some useful links:</Text>

      <View style={styles.linksContainer}>
        <Button
          title="LinkedIn"
          onPress={() => Linking.openURL("https://www.linkedin.com/in/your-profile")}
        />
        <Button
          title="GitHub"
          onPress={() => Linking.openURL("https://github.com/your-username")}
        />
        <Button
          title="Resume"
          onPress={() => Linking.openURL("/resume.pdf")}
        />
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
    justifyContent: "center",
    alignItems: "center",
    padding: 20,
    backgroundColor: "#f5f5f5",
    minHeight: "100vh", // Ensure it takes up the full height
  },
  header: {
    fontSize: 32,
    fontWeight: "bold",
    color: "#333",
    marginBottom: 20,
    textAlign: "center",
  },
  subtitle: {
    fontSize: 18,
    color: "#555",
    marginBottom: 30,
    textAlign: "center",
  },
  linksContainer: {
    flexGrow: 1,
    width: "100%",

    justifyContent: "space-evenly",
    alignItems: "center",
    marginTop: 20,
  },
  button: {
    marginBottom: 10,  // Space between buttons
    width: "80%",      // Buttons take up 80% of the width
  },
});

export default App;
